// src/components/TourList.js
import React from 'react';
import { Link } from 'react-router-dom';

const TourList = ({ tours }) => {
  return (
    <div>
      <h2>Available Tours</h2>
      <ul>
        {tours.map((tour) => (
          <li key={tour._id}>
            <Link to={`/tour/${tour._id}`}>{tour.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TourList;
